description:
It's time for a 2nd edition of chambermaid fun!

The hotel was already a hot and horny place and nothing much has changed since the time the new chambermaid joined the team. It turns out Sweet Slut Victoria was more than an innocent chambermaid who made beds and completed the general cleaning. Her naughty appetite was far from shrinking. In fact, it had only grown bigger since she discovered the hotelier's hidden cameras.

